import React from "react";

const PersonalInfoBar = () => {
  return (
    <div
      style={{
        width: "100%",      // Tam genişlik
        height: "60px",     // Yükseklik
        backgroundColor: "#4CAF50", // Yeşil arka plan
        display: "flex",
        alignItems: "center",
        padding: "0 20px",
        color: "white",
        fontWeight: "bold",
        fontSize: "18px",
        boxSizing: "border-box",  // Kenar boşluklarını hesaba kat
        margin: 0,
        borderRadius: 0,    // Kenar yuvarlama yok
        boxShadow: "none"   // Gölge yok
      }}
    >
      Hasta Bilgi Sistemi
    </div>
  );
};

export default PersonalInfoBar;
